import React from 'react'
import { useParams } from 'react-router-dom'
function ModificarCuenta() {
    const token="eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYyYTYyZTM4MDBiMTJhY2Y1Yzk2YzBhYyIsImlhdCI6MTY1NTEzOTgwMCwiZXhwIjoxNjU1MjI2MjAwfQ.STKSJBTXBPJV2RCkf6JpVT0zP0cSyZWAyjqVAp5zQ6c"
    const [cuenta, setCuenta] = useState([])
    const params = useParams()
    useEffect(()=>{
        axios.get(`/cuentas/${params.id}`,{ headers: {"x-access-token" : `${token}`} })
        .then(response => setCuenta(response.data))
        .catch(error => console.log(error))
    },[])
  return (
    <div>ModificarCuenta</div>
  )
}

export default ModificarCuenta
